✳︎主食
・ペレット27gくらい（-3g）🍙
今まで30gだったのを27gくらいにしました。少しずつ減らしてく作戦です。2種類のものを混ぜてあげてます。1種類しかあげてなかった時に全然食べてくれなかった時期があったので、食べなくなった時に備えて保険にもう一種類あげてます。今後また別のペレットも検討中です。
・チモシーにオーツヘイ追加🌿
アルファルファ辞めたかわりにオーツヘイを混ぜてみました。これがかなり食いつきがいい✨前にも増してチモシー食べてくれるようになりました😆
・乳酸菌⚪️
これ美味しいらしく真っ先にこれに食いつきます。

✳︎他おやつなど
・換毛にいいらしい？おやつ🍪
結構好きらしく、ペレットより先に食べてます。安かったので買ってみました。
・野菜🥬
私がスーパーに行ったタイミングで新鮮なものをたまに。大葉・セロリ・小松菜など。基本何でも食べる子なので本に載ってる野菜は一通りあげてます。ペレット食べてくれなくなった時は野菜を多めにあげてます。
・りんご🍎
人と仲良くなってもらいたい時にあげます。私の彼とか友達とかから貰えるレアアイテム。これをあげると途端に愛想が良くなります笑 私もたまーにあげてます。

以上です！
最近換毛が始まってますが、今のところ食欲落ちる事なくとても元気にうんち●してくれてます🌞うんち●がでっかいと嬉しいですね！😆うさぎを飼う前は、うんち●沢山するの嫌だと思ってましたが、今では沢山うんちしてる様子を見るととても嬉しく感じます😂だってそれだけ元気ってことですかね😉今後もひなたの成長のペースに合わせてご飯は改良していきたいと思っています。
