⁣
❌ According to a Smithsonian Conservation Biology Institute study, free-roaming cats kill an estimated average of 2.4 BILLION birds and 12.3 BILLION mammals EVERY YEAR. ⁣
❌ This includes endangered species of birds who are already facing an uphill battle for survival. ⁣
❌ That massive death toll makes cats a bigger threat to wildlife than nearly any other human-linked cause.⁣
❌ Cats often “play” with their victims, dragging out the animals’ terror and suffering. ⁣
❌ Cats don’t always kill animals swiftly, sometimes leaving them maimed to suffer with horrific injuries.⁣
